import React, { useState } from "react";
import singer from "./singer.png";
import "./Register.css";
import Validation from "./Validation";

const Registration = () => {
  const initialDetails = {
    name: "",
    UserName: "",
    email: "",
    number: "",
    checkbox: false,
  };

  const [details, setDetails] = useState(initialDetails);
  const [disable, setDisable] = useState("typing");
  const [message, setMessage] = useState("");
  const[errors,setError]=useState({})

  const handleChange = (e) => {
    const { name, value } = e.target;
    setDetails((prev) => {
      return { ...prev, [name]: value };
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setDetails(initialDetails);
    setDisable("submitted");
    setError(Validation(details));

    console.log(details);
  };

  const handleMessage = (e) => {
    if (disable === "submitted") {
      setMessage("");
    } else {
      setMessage("Field is Required");
    }
  };

  return (
    <div>
      <div className="board">
        <img className="image" src={singer} alt="not found" />
        <p className="discover">Discover new things on Superapp</p>
      </div>
      <div className="form-Select">
        <h4 className="Heading">Superapp</h4>
        <h4 className="Heading2">Create your new account </h4>
        <form onSubmit={handleSubmit}>
          <input
            className="name"
            type="text"
            placeholder="name"
            name="name"
            onChange={handleChange}
            value={details.name}
          />
          {/* <p className="error-message1" onClick={handleMessage} value={message}>
            {" "}
            Field is Required
          </p> */}

         
          <input
            className="UserName"
            type="text"
            placeholder="UserName"
            name="UserName"
            onChange={handleChange}
            value={details.UserName}
          />
          <p className="error-message2" onClick={handleMessage} value={message}>
            {" "}
            Field is Required
          </p>
            }
          <input
            className="email"
            type="email"
            name="email"
            id="emailInputID"
            placeholder="email"
            onChange={handleChange}
            value={details.email}
          />
          <p className="error-message3" onClick={handleMessage} value={message}>
            {" "}
            Field is Required
          </p>

          <input
            className="number"
            type="number"
            name="number"
            id="numberInputID"
            placeholder="mobileNumber"
            onChange={handleChange}
            value={details.number}
          />
          <p className="error-message4" onClick={handleMessage} value={message}>
            {" "}
            Field is Required
          </p>

          <input
            className="checkbox"
            type="checkbox"
            name="checkbox"
            id=""
            onChange={handleChange}
            value={details.checkbox}
          />

          <p className="tickbox">Share my registration data with Superapp</p>

          <button
            className="signUp"
            onClick={handleSubmit}
            disabled={
              details.name.length === 0 ||
              details.UserName.length === 0 ||
              details.email.length === 0 ||
              details.number.length === 0 ||
              details.checkbox === true ||
              disable === "submitted"
            }
          >
            SIGN UP
          </button>

          <p className="line1">
            By clicking on Sign up. you agree to Superapp
            <span className="Terms">Terms and Conditions of Use</span>
          </p>
          <p className="line2">
            To learn more about how Superapp collects, uses, shares and protects
            your personal data please head Superapp
            <span className="Terms"> Privacy Policy</span>
          </p>
        </form>
      </div>
    </div>
  );
};

export default Registration;
